CREATE DEFINER=`admin`@`localhost` PROCEDURE `delete_unsaved_games` ()  MODIFIES SQL DATA
DELETE FROM `games` WHERE `saved` = 0 AND `updated_at` < NOW() - INTERVAL 2 HOUR$$

DELIMITER ;

